	('TEREZA BEATRIZ RIBEIRO HERLING', '62706542', '370100000000000', 24, 2, 'CAU A10623-2', '(11)  3113-7757', 'therling@prefeitura.sp.gov.br', 'DESCRIÇÃO DETALHADA das atividades a serem desenvolvidas pela estagiária, a fim de permitir a avaliação da Comissão de Estágios:\r\nA estagiária trabalhará com a equipe de planejamento e gestão de projetos dos Territórios CEUs  - meta nº 16 do Programa de Metas 2013-2016. Ela apoiará o desenvolvimento do material de comunicação dos projetos e ações e acompanhará todas as etapas de desenvolvimento do projeto.\r\n\r\nATIVIDADES PROGRAMADAS:\r\nDar continuidade as atividades exercidas no semestre anterior como: apoiar o desenvolvimento de apresentações digitais, publicações, mapas e projetos, explorando linguagens gráficas que comuniquem o conteúdo do projeto. Além disso, acompanhará atividades de: levantamento e diagnóstico em campo, desenvolvimento de plataforma digital, reuniões com a comunidade e audiências públicas.\r\n\r\nCONHECIMENTOS DECORRENTES:\r\nA estagiária aprimorará habilidades relativas a: representação gráfica, desenvolvimento de mapas temáticos, uso de programas de georreferenciamento (QGIS), análise urbana, intervenção urbana, projeto de edifício e noções de gestão de projeto.', 'INATIVO', NULL),
