	('HELOISA TOOP SENA REBOUÇAS', '64841661', '370102000000000', 21, 8, 'OAB 110310', '(11) 3113-7770', 'hreboucas@PREFEITURA.SP.GOV.BR', 'OBJETIVO GERAL: Inteirar a estudante de Direito do ambiente e principais rotinas da Administração Pública Direta Municipal. OBJETIVO ESPECÍFICO: Conhecimento da matéria jurídica tratada na SMDU: Direito Administrativo e Urbanístico, Estatuto da Cidade, Plano Diretor Estratégico do Município, Disciplina do parcelamento, uso e ocupação do solo, instrumentos de Política Urbana, como Operações urbanas Consorciadas, Áreas de Intervenção Urbana, Concessão Urbanística, inclusive pesquisa de Direito Comparado, elaboração de termos e expedição de Certidões, matéria de Recursos Humanos, Estatuto dos Funcionários, aquisições, licitações e contratações, atos administrativos preparatórios, elaboração de editais, atos homologatórios e de adjudicação, recursos administrativos e impugnações, preparação de contratos e termos similares e eventual acompanhamento de contencioso para complementação das informações prestadas pelo Departamento Judicial da Secretaria de Negócios Jurídicos, nas causas em que a Secretaria é diretamente interessada. A estagiária terá a oportunidade de lidar com atos administrativos variados, normas processuais, pareceres, despachos decisórios e respectivas publicações no Diário Oficial da Cidade. ATIVIDADES GERAIS: Atuação direta no auxílio dos trabalhos dos Procuradores e Assessores Jurídicos, elaborando, sob orientação, minutas, pesquisas, consultas a bibliotecas, Referência Legislativa, Internet, organização e arquivo de documentos, elaboração de banco de dados com jurisprudência administrativa nas matérias pertinentes à Secretaria, atualização de informações forenses, pesquisas nos tribunais, inclusive no Federal e de Contas, Ministério Público, intercâmbio de informações com demais órgãos da Administração Direta e Indireta. ATIVIDADE ESPECÍFICA: Pesquisa de Direito Comparado sobre Concessão Urbanística e outros instrumentos de política urbana para reorganização do território visando a formação de um banco de dados específico.', 'ATIVO', '18355583809'),
