	('MARCELO CARDOSO GONTIJO', '75205141', NULL, 19, 10, 'CREA-600409200', '(11)  3113-7933', 'mgontijo@prefeitura.sp.gov.br', 'OBJETIVO GERAL: Auxiliar nas principais rotinas da Administração Pública Direta Municipal\r\nAUXILIAR na matéria jurídica tratada na SMDU, em especial no DEUSO, relativa a direito urbanístico, Estatuto da Cidade, Plano Diretor, Disciplina de parcelamento, uso e ocupação do solo.\r\nATIVIDADES GERAIS: auxilair nos trabalhos da Assessoria Técnica do DEUSO elaborando minutas, pesquisas, consultas, consolidação de legislação, organização e arquivo de documentos.\r\nATIVIDADE ESPECÍFICA: auxiliar  nos trabalhos da Assessoria Técnica do DEUSO na revisão da legislação de parcelamento, uso e ocupação do solo e posterior regulamentação e aplicação.', 'INATIVO', '66739462887'),
	('MARIA CRISTINA DE SOUZA BORTOLETTO', '75206541', '370002020000000', 10, 2, 'CAU 25026-0', '(11)  3113-7813', 'mbortoletto@prefeitura.sp.gov.br', 'Estudos das diversas tipologias das zonas de uso, utilizando a cidade como objeto;\r\nAplicar o conhecimento da ocupação urbana do Município de São Paulo e de observar como a “cidade real” se insere na “cidade legal”, observando, também, os conflitos resultantes desse conflito;\r\nAuxilia no Mapeamento das vistorias realizadas, para subsidiar os processos analisados pela equipe técnica da SMDU;\r\nAuxilia na elaboração dos trabalhos em desenvolvimento no Departamento do Uso do Solo – DEUSO, objetivando a compreensão da legislação urbana e de sua aplicabilidade no dia a dia da cidade;\r\nAuxulia nos  trabalhos desenvolvidos na Secretaria Municipal de Desenvolvimento Urbano, tendo por objetivo estabelecer uma metodologia de analise e de estudo das diversas ocorrências urbanas;\r\nConhecimento histórico da legislação de uso e ocupação do solo;\r\nAplicação dos novos enquadramentos das atividades.', 'INATIVO', '1176758810'),
	('LISANDRO FRIGERIO', '75208751', NULL, 19, 2, 'CREA 5061093110', '(11)  3113-7804', 'lfrigerio@prefeitura.sp.gov.br', 'Tomar conhecimento de rotinas e métodos de trabalhos utilizados no setor de cadastro de Zoneamento, Participar da elaboração/atualização de cadastro de Zoneamento,Organizar arquivo (Zona de uso e classificação viária) referente á nova lei de uso e ocupação do solo, por Subprefeitura.Digitar dados referentes ao Zoneamento em planilhas Excel para serem enviadas a PRODAM. Analisar  informações constantes em quadras fiscais e efetuar planilhas de dados por S.Q.L  ( setor /quadra/lote) e por tipo de Zoneamento em planilhas Excel   e enviar a PRODAM, PARA SISZON; Suporte técnico relativo a dados de contribuintes (S.Q.L), nas consultas de processos. Oferecer subsídios para elaboração de dados para trabalhos desenvolvidos neste Departamento.', 'ATIVO', '25318990819'),
