	('HE NEM KIM SEO', '78640782', '370002010000000', 10, 2, 'CAU 108.399-6', '(11)  3113-7964', 'hseo@prefeitura.sp.gov.br', 'ATIVIDADES PROGRAMADAS:\r\nOrganizar arquivos (zona de uso e classificação viária) referentes à nova lei de uso e ocupação do solo, por Subprefeitura.\r\nDigitar dados referentes ao zoneamento em planilhas Excel para serem enviadas a Prodam.\r\n\r\nTomar conhecimento de rotinas e métodos de trabalhos utilizados no setor de cadastro de zoneamento.Participar da elaboração/atualização de cadastro de zoneamento. Todas as atividades serão acompanhadas por técnicos da mesma área de formação do estudante. Analisar informações constantes em quadras fiscais  e planilhar dados por S.Q.L (setor/quadra/lote) e por tipo de zoneamento em planilhas Excel e enviar a Prodam, para  o SISZON. Suporte técnico relativo a dados de contribuintes (S.Q.L.) nas consultas de processos.  Auditar o zoneamento (zonas de uso e classificação viária) cadastrado no Siszon (sistema de zoneamento) nos termos da Lei 13885/2004, de todos os contribuintes pertencentes às Subprefeituras objetos de conferência/atualização.\r\nLevantamento de dados para manutenção/atualização do Siszon. Suporte técnico relativo a dados de contribuintes (S.Q.L.) nas consultas de processos.\r\n\r\nCONHECIMENTOS DECORRENTES:\r\nAplicação dos sistemas de consulta:\r\nZoneamento- SISZON, cadastro unificado- SUC, mapa digital da cidade- MDC.\r\nConhecimento e aplicação da nova lei de uso e ocupação do solo do município de São Paulo.', 'Ativo', '22890428893'),
