	('THAÍS AGUIAR CRUZ', '81098931', '2', 13, 18, '31594/RJ', '(11)  3113-7793', 'taguiar@prefeitura.sp.gov.br', 'JORNALISMO:\r\n ATIVIDADE PROGRAMADAS:\r\n- Auxiliar no desenvolvimento de material gráfico;\r\n- Auxiliar na elaboração relatórios;\r\n- Auxiliar na comunicação interna;\r\n- Apoio a Assessoria de Imprensa;\r\n- Enviar e receber e-mails de divulgação de Projetos e Ações;\r\n- Desenvolvimento Textos;\r\n- Demais atividades pertinentes a sua formação.\r\n\r\nCONHECIMENTO DECORRENTE\r\nAcompanhamento da rotina da assessoria de imprensa e desenvolvimento de trabalhos de clipagem e relacionamento com a imprensa.\r\n\r\nDESENVOLVIMENTO SISTEMAS/PROGRAMAÇÃO\r\nauxiliar nas criações e manutenções de plataformas web (wordpress/php) da SMDU Prefeitura de São Paulo. Para tanto, serão envolvidos conhecimentos em html, css, javascript, jquery, php ou worpress', 'INATIVO', NULL),
