	('Ana Paula Maia Borlenghi', '81110491', '370406040000000', 30, 2, 'CAU-SP A89963-1', NULL, 'aborlenghi@PREFEITURA.SP.GOV.BR', NULL, 'ATIVO', '147.424.438-61'),
	('LYGIA MARIA DE QUEIROZ CABRAL', '81110901', '370204050020000', 26, 2, 'CAU SP A852538', '(11) 03243-1069', 'lygiafalco@prefeitura.sp.gov.br', NULL, 'ATIVO', '36538654843'),
	('maria jose lima de aragão silva', '81135641', '370205040000000', 16, 1, 'cra 0001010', '(11) 03243-1009', 'mjlaragao@prefeitura.sp.gov.br', NULL, 'ATIVO', '66195837415'),
	('Tassia Botti Bozza', '81153462', '370302030000000', 4, 2, 'CAU-SP A124196-6', '(11) 03113-7962', 'tbozza@prefeitura.sp.gov.br', NULL, 'ATIVO', '418.088.088-19'),
	('MARCELLA CORRÊA MARTINS', '81254811', '370010030000000', 7, 8, 'OAB - 294806', '(11)  3113-7946', 'marcellamartins@PREFEITURA.SP.GOV.BR', NULL, 'INATIVO', NULL),
	('ROSANA YAMAGUTI', '81268103', '370002000000000', 3, 2, 'CAU -A89313-7', '(11) 3113-7943', 'ryamaguti@prefeitura.sp.gov.br', 'Estudos das diversas tipologias das zonas de uso, utilizando a cidade como objeto;\r\nAplicar o conhecimento da ocupação urbana do Município de São Paulo e de observar como a “cidade real” se insere na “cidade legal”, observando, também, os conflitos resultantes desse conflito;\r\nMapeamento das vistorias realizadas, para subsidiar os processos analisados pela equipe técnica da SMDU;\r\nParticipar da elaboração dos trabalhos em desenvolvimento no Departamento do Uso do Solo – DEUSO, objetivando a compreensão da legislação urbana e de sua aplicabilidade no dia a dia da cidade;\r\nTer conhecimento dos trabalhos desenvolvidos na Secretaria Municipal de Desenvolvimento Urbano, tendo por objetivo estabelecer uma metodologia de analise e de estudo das diversas ocorrências urbanas;\r\nConhecimento histórico da legislação de uso e ocupação do solo;\r\nAplicação dos novos enquadramentos das atividades.', 'INATIVO', '22440732893'),
	('Andre kviatkovski', '81357112', '370115000000000', 3, 23, NULL, '(11) 03113-7761', NULL, NULL, 'ATIVO', '371.729.778-31'),
	('EDUARDO AUGUSTO ARTEIRO DE FARIAS', '81359592', '370010000000000', 3, 8, 'OAB SP Nº 335.835', '(11)  3113-7819', 'earteiro@prefeitura.sp.gov.br', 'OBJETIVO GERAL: Inteirar o estudante de Direito do ambiente e principais rotinas da Administração Pública Direta Municipal. OBJETIVO ESPECÍFICO: Conhecimento da matéria jurídica tratada na SMDU,em especial no DCFSP relativa a  Direito .  - ATIVIDADES GERAIS:  atuação direta dos trabalhos de Divisão de assuntos Jurídicos, Divisão de Acompanhamento de Notificações e Gabinete do DCFSP, elaboração de pesquisas, consultas analises de registros imobiliários, consolidação de legislação, organização e arquivo de documentos,  - ATIVIDADES ESPECIFICAS: Auxilio dos trabalhos da Divisão de Assuntos Jurídicos, Divisão de Acompanhamento de Notificações e Gabinete do DCFSP na aplicação do instrumento de parcelamento, edificação e utilização compulsórios, analisando matrículas de imóveis e elaborando pesquisas para fundamentar pareceres.', 'ATIVO', '36151437870'),
	('LARISSA DE PIERI GRIZOLI', '81662421', '2', 4, 15, '0061773-SP', '(11)  3113-7765', 'lgrizoli@PREFEITURA.SP.GOV.BR', 'JORNALISMO:\r\n Auxiliar: \r\n- Desenvolvimento de material gráfico \r\n- Elaborar relatórios, \r\n- Auxiliar na comunicação interna, \r\n- Apoio a Assessoria de Imprensa \r\n- Enviar e receber e-mails de divulgação de Projetos e Ações \r\n- Desenvolvimento Textos', 'INATIVO', NULL),
	('TALITA VEIGA CAVALLARI', '81701001', '370004030000000', 22, 2, 'CAU -A111152-3', '(11) 03313-7939', 'tcavallari@prefeitura.sp.gov.br', '**ARQUITETURA:**\r\nAUXILIAR NA(O):\r\n- Elaboração de mapas, listagens e tabelas para subsidiar análise das propostas apresentadas na SEOC.\r\n- Realização de levantamentos e sistematização de dados através da pesquisa, compatibilização e atualização do banco de dados, para consulta, sobre os atos e assuntos tratados nas reuniões e no âmbito da Secretaria Executiva;\r\n- Apoio ao atendimento ao público referente à aplicação da legislação de uso e ocupação do solo;\r\n- Acompanhamento a elaboração de slides de 	Apresentação dos processos da pauta de cada reunião.\r\n- Demais atividades pertinentes a secretaria.', 'INATIVO', '41264748892'),
	('Talita Veiga Cavallari Fonseca', '81701007', '370115000000000', 4, 2, NULL, NULL, NULL, NULL, 'ATIVO', '412.647.488-92'),
	('FABIO MARIZ GONÇALVES', '81792211', '370001000000000', 6, 2, 'CAU 278416', '(11)  3113-7893', 'fabiomgoncalves@prefeitura.sp.gov.br', 'OBJETIVO:\r\nConsiderando as atribuições do Departamento de Urbanismo desta Secretaria, quanto à coordenação e implementação do Plano Diretor deste Município com o apoio das outras Secretarias, pretende-se que o estagiário possa, com os conhecimentos teóricos adquiridos na Universidade, detectar na prática as diversas visões de planejamento que atuam nesta cidade, as demandas da sociedade quanto ao plano urbanístico-ambiental, bem como a diferenciação existente no estabelecimento das diretrizes nas escalas macro/global (Plano Diretor) e local (Planos Regionais).\r\n\r\nATIVIDADES:\r\nAuxiliar na elaboração de mapas, desenhos, apresentações, vistorias, levantamentos de dados, planilhas e textos constituintes das atividades desenvolvidas pelo departamento, como revisões do Plano Diretor Estratégico, dos planos regionais das Subprefeituras e projetos urbanísticos.', 'INATIVO', NULL),
	('Caroline Maderic Riquino', '81922862', '370304000000000', 22, 2, 'CAU-SP 136721-8', NULL, NULL, NULL, 'ATIVO', '420.031.798-28'),
